UML:TaggedValue.value:
A LinearOrientationProperties  instance is a kind of GeometricDescriptionValue, and SHALL inherit the properties from that class;
A LinearOrientationProperties instance MAY have additional properties for plunge and trend  that are numeric range value, and a directed property that is a code value indicating whether the orientation has a distinct polarity.
At least one of plunge or trend SHALL have a value that is not nil.
